import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { 
  ArrowRightIcon, 
  CheckCircleIcon, 
  MagnifyingGlassIcon,
  BuildingOfficeIcon,
  UserGroupIcon,
  ShieldCheckIcon,
  ChartBarIcon,
  MapPinIcon,
  ClockIcon,
  DocumentCheckIcon,
  BuildingLibraryIcon,
  CreditCardIcon,
  ChevronDownIcon
} from '@heroicons/react/24/outline';

const specialties = ["Cardiology", "Orthopedics", "Pediatrics", "Neurology", "Dermatology", "Primary Care"];
const locations = ["New York, NY", "Los Angeles, CA", "Chicago, IL", "Houston, TX", "Boston, MA"];

const generateMoreProviders = (specialty, color, locations) => {
  const hospitals = {
    "New York, NY": ["Mount Sinai", "NewYork-Presbyterian", "Columbia Presbyterian", "NYU Langone", "Memorial Sloan Kettering", "Hospital for Special Surgery", "Lenox Hill", "Bellevue", "Beth Israel", "Weill Cornell"],
    "Los Angeles, CA": ["UCLA Medical Center", "Cedars-Sinai", "USC Medical Center", "Providence Saint John's", "Good Samaritan", "Children's Hospital LA", "Kaiser Permanente", "Ronald Reagan", "City of Hope", "Beverly Hills Medical"],
    "Chicago, IL": ["Northwestern Memorial", "Rush University", "University of Chicago", "Lurie Children's", "Illinois Masonic", "University of Illinois", "Advocate Christ", "Rush Oak Park", "Swedish Covenant", "Saint Joseph"],
    "Houston, TX": ["Texas Medical Center", "Houston Methodist", "Memorial Hermann", "MD Anderson", "Baylor St. Luke's", "Texas Children's", "Houston Presbyterian", "Park Plaza Hospital", "HCA Houston", "Memorial City"],
    "Boston, MA": ["Mass General", "Brigham and Women's", "Boston Children's", "Beth Israel Deaconess", "Tufts Medical", "Boston Medical Center", "Dana-Farber", "Newton-Wellesley", "Mount Auburn", "St. Elizabeth's"]
  };

  const firstNames = ["James", "Mary", "John", "Patricia", "Robert", "Jennifer", "Michael", "Linda", "William", "Elizabeth", "David", "Susan", "Richard", "Jessica", "Joseph", "Sarah", "Thomas", "Karen", "Charles", "Nancy"];
  const lastNames = ["Smith", "Johnson", "Williams", "Brown", "Jones", "Garcia", "Miller", "Davis", "Rodriguez", "Martinez", "Hernandez", "Lopez", "Gonzalez", "Wilson", "Anderson", "Thomas", "Taylor", "Moore", "Jackson", "Martin"];

  return locations.flatMap((location, index) => {
    return hospitals[location].map((hospital, hIndex) => {
      const firstName = firstNames[Math.floor(Math.random() * firstNames.length)];
      const lastName = lastNames[Math.floor(Math.random() * lastNames.length)];
      return {
        id: `${specialty}-${location}-${hIndex}`,
        name: `Dr. ${firstName} ${lastName}, MD`,
        specialty: specialty,
        specialtyColor: color,
        location: location,
        hospital: hospital,
        email: `${firstName.toLowerCase()}.${lastName.toLowerCase()}@${hospital.toLowerCase().replace(/[^a-z0-9]/g, '')}.org`,
        phone: `(${location === "New York, NY" ? "212" : 
                   location === "Los Angeles, CA" ? "310" :
                   location === "Chicago, IL" ? "312" :
                   location === "Houston, TX" ? "713" :
                   "617"}) ${Math.floor(Math.random() * 900 + 100)}-${Math.floor(Math.random() * 9000 + 1000)}`
      };
    });
  });
};

const sampleData = [
  ...generateMoreProviders("Cardiology", "red", locations),
  ...generateMoreProviders("Orthopedics", "blue", locations),
  ...generateMoreProviders("Pediatrics", "green", locations),
  ...generateMoreProviders("Neurology", "purple", locations),
  ...generateMoreProviders("Dermatology", "pink", locations),
  ...generateMoreProviders("Primary Care", "emerald", locations)
];

const LandingPage = () => {
  const [isVisible, setIsVisible] = useState(false);
  const [currentData, setCurrentData] = useState([]);
  const [searchText, setSearchText] = useState("");
  const [selectedSpecialty, setSelectedSpecialty] = useState(0);
  const [selectedLocation, setSelectedLocation] = useState(0);

  // Filter data based on selected filters
  const filterData = () => {
    const specialty = specialties[selectedSpecialty];
    const location = locations[selectedLocation];

    let filtered = [...sampleData];

    // Filter by specialty if not "All Specialties"
    if (specialty && specialty !== "All Specialties") {
      filtered = filtered.filter(item => item.specialty === specialty);
    }

    // Filter by location if not "All Locations"
    if (location && location !== "All Locations") {
      filtered = filtered.filter(item => item.location === location);
    }

    // Return random 5 items from filtered results
    return filtered.sort(() => Math.random() - 0.5).slice(0, 5);
  };

  useEffect(() => {
    setIsVisible(true);

    // Initial data load
    setCurrentData(filterData());

    // Animate data changes
    const dataInterval = setInterval(() => {
      setCurrentData(filterData());
    }, 3000);

    // Animate search text
    const searchInterval = setInterval(() => {
      const specialty = specialties[selectedSpecialty];
      setSearchText(specialty === "All Specialties" ? "" : specialty);
      setSelectedSpecialty((prev) => (prev + 1) % specialties.length);
    }, 2000);

    // Animate location filter
    const locationInterval = setInterval(() => {
      setSelectedLocation((prev) => (prev + 1) % locations.length);
    }, 4000);

    return () => {
      clearInterval(dataInterval);
      clearInterval(searchInterval);
      clearInterval(locationInterval);
    };
  }, [selectedSpecialty, selectedLocation]);

  // Update data when filters change
  useEffect(() => {
    setCurrentData(filterData());
  }, [selectedSpecialty, selectedLocation]);

  return (
    <div className="min-h-screen bg-white">
      {/* Navigation */}
      <nav className="fixed w-full z-50 bg-white border-b border-gray-200">
        <div className="max-w-7xl mx-auto px-6 py-4">
          <div className="flex items-center justify-between">
            <div className="flex items-center space-x-8">
              <Link to="/" className="text-xl font-semibold">
                Medical Provider Leads
              </Link>
              <div className="hidden md:flex space-x-1">
                <button className="px-3 py-2 text-gray-600 hover:text-gray-900 inline-flex items-center">
                  Product <ChevronDownIcon className="w-4 h-4 ml-1" />
                </button>
                <button className="px-3 py-2 text-gray-600 hover:text-gray-900 inline-flex items-center">
                  Solutions <ChevronDownIcon className="w-4 h-4 ml-1" />
                </button>
                <Link to="/pricing" className="px-3 py-2 text-gray-600 hover:text-gray-900">
                  Pricing
                </Link>
                <button className="px-3 py-2 text-gray-600 hover:text-gray-900 inline-flex items-center">
                  Community <ChevronDownIcon className="w-4 h-4 ml-1" />
                </button>
                <button className="px-3 py-2 text-gray-600 hover:text-gray-900 inline-flex items-center">
                  Resources <ChevronDownIcon className="w-4 h-4 ml-1" />
                </button>
              </div>
            </div>
            <div className="flex items-center space-x-4">
              <Link to="/contact" className="text-gray-600 hover:text-gray-900">
                Contact sales
              </Link>
              <Link to="/dashboard" className="bg-gray-100 text-gray-900 px-4 py-2 rounded-lg hover:bg-gray-200">
                My dashboard
              </Link>
            </div>
          </div>
        </div>
      </nav>

      {/* New Product Banner */}
      <div className="bg-[#4763FF] text-white">
        <div className="max-w-7xl mx-auto px-6 py-2">
          <div className="flex items-center justify-center space-x-2 text-sm">
            <span className="bg-white/20 px-2 py-0.5 rounded text-xs font-medium">New</span>
            <span>Provider Intelligence v2.0 is now available</span>
            <span className="text-white/80">→</span>
          </div>
        </div>
      </div>

      {/* Hero Section */}
      <div className="relative pt-32 pb-20 px-6 lg:px-8">
        <div className="mx-auto max-w-7xl text-center">
          <h1 className="text-5xl md:text-6xl font-bold tracking-tight text-gray-900 mb-6">
            Create it. Scale it. Own it.
          </h1>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            The open platform to create scalable healthcare provider databases and applications—without coding.
          </p>
          <div className="flex items-center justify-center space-x-4 mt-8">
            <Link to="/signup" className="bg-[#4763FF] text-white px-6 py-3 rounded-lg font-medium hover:bg-[#3651E3] transition-colors">
              Try now for free
            </Link>
            <Link to="/platform" className="bg-gray-100 text-gray-900 px-6 py-3 rounded-lg font-medium hover:bg-gray-200 transition-colors">
              Discover the platform
            </Link>
          </div>
        </div>
      </div>

      {/* Product Preview */}
      <div className="relative px-6 lg:px-8 pb-32">
        <div className="mx-auto max-w-7xl">
          <div className={`transition-all duration-1000 transform ${isVisible ? 'translate-y-0 opacity-100' : 'translate-y-8 opacity-0'}`}>
            <div className="bg-white border border-gray-200 rounded-xl shadow-xl overflow-hidden">
              <div className="border-b border-gray-200 p-4">
                <div className="flex items-center justify-between">
                  <div className="flex items-center space-x-4">
                    <button className="inline-flex items-center space-x-1 text-gray-600">
                      <span>Grid</span>
                      <ChevronDownIcon className="w-4 h-4" />
                    </button>
                    <button className="inline-flex items-center space-x-1 text-gray-600">
                      <span>Filter</span>
                      <ChevronDownIcon className="w-4 h-4" />
                    </button>
                    <button className="inline-flex items-center space-x-1 text-gray-600">
                      <span>Sort</span>
                      <ChevronDownIcon className="w-4 h-4" />
                    </button>
                    <button className="inline-flex items-center space-x-1 text-gray-600">
                      <span>Share view</span>
                    </button>
                  </div>
                  <div className="flex items-center space-x-2">
                    <span className="inline-flex items-center space-x-1 text-gray-600">
                      <span>2 colors</span>
                    </span>
                  </div>
                </div>
              </div>

              <div className="overflow-x-auto">
                <table className="min-w-full divide-y divide-gray-200">
                  <thead className="bg-gray-50">
                    <tr>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Name
                      </th>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Specialty
                      </th>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Location
                      </th>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Status
                      </th>
                    </tr>
                  </thead>
                  <tbody className="bg-white divide-y divide-gray-200">
                    {currentData.map((provider, index) => (
                      <tr key={provider.id} className="hover:bg-gray-50">
                        <td className="px-6 py-4 whitespace-nowrap">
                          <div className="flex items-center">
                            <div className="text-sm font-medium text-gray-900">{provider.name}</div>
                          </div>
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap">
                          <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-blue-100 text-blue-800">
                            {provider.specialty}
                          </span>
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                          {provider.location}
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                          <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-green-100 text-green-800">
                            Active
                          </span>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Trusted By Section */}
      <div className="border-t border-gray-200 bg-gray-50">
        <div className="max-w-7xl mx-auto px-6 py-16">
          <p className="text-center text-sm text-gray-600 mb-8">
            Trusted by thousands of companies in 100+ countries
          </p>
          <div className="grid grid-cols-2 gap-8 md:grid-cols-6 items-center justify-items-center opacity-60">
            <img src="/logos/logo1.png" alt="Company logo" className="h-8" />
            <img src="/logos/logo2.png" alt="Company logo" className="h-8" />
            <img src="/logos/logo3.png" alt="Company logo" className="h-8" />
            <img src="/logos/logo4.png" alt="Company logo" className="h-8" />
            <img src="/logos/logo5.png" alt="Company logo" className="h-8" />
            <img src="/logos/logo6.png" alt="Company logo" className="h-8" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
